School started a few weeks ago.  It has been extremely tough to stay on track with meals, water, movement, and even sleep.

The emotional toll is high.  I LOVE being in school with the kids.  It's just extreme highs and extreme lows right now.  Because the stress is so high, I haven't followed anything to plan.  Food is hit or miss and not as consistent, sleep is worse, movement and water have been the most consistent, which is weak also.  I keep planning an afternoon walk, but wanting to not let school work loom over my head gets the priority of my extra time.  Drinking water is more of a chore with being in a mask all day and VERY limited breaks to use the bathroom.  There have been SO MANY changes with teaching and the schedule and I honestly haven't handled any of it well...at all.

So, while this isn't how I wanted to end the @1stphorm Summer Sprint Challenge, this isn't the end of my journey.  This will be a great time for me to re-assess myself - what are my goals?  What am I striving for?  I need to re-gain my focus and remind myself WHY...why I need afternoon movement, why I need to eat all of my meals, why I need to drink all of my water, why I need to sleep more and better, why taking all of my supplements helps me.

Life will throw you some doozies!  We may not always handle them the best in that moment.  TBH, it doesn't matter all that much - it's how you handle yourself afterwards.  It's the lesson learned and improvement made that makes the biggest impact.

So, I'll evaluate my situation, determine what I want, and move forward with a new plan, a new attitude, and a new mindset.

My eyes will be on the prize once again.";}i:225;a:1:{s:14:"comments_count";i:3;}i:226;a:1:{s:11:"likes_count";i:8;}i:227;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvJUarMD2l";}i:228;a:1:{s:5:"image";s:250:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118708626_1382096218848808_1592422135740462947_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=EekaRTndgNYAX9X2jog&oh=20465b91ad028673d101983dcc80525b&oe=5F7E7774";}i:229;a:1:{s:4:"type";s:5:"image";}i:230;a:1:{s:8:"owner_id";i:208400340;}i:231;a:1:{s:14:"owner_username";s:0:"";}i:232;a:1:{s:14:"owner_fullname";s:0:"";}i:233;a:1:{s:9:"owner_pic";s:0:"";}i:234;a:1:{s:2:"id";s:19:"2391170474073568297";}i:235;a:1:{s:10:"short_code";s:11:"CEvJOCQjrQp";}i:236;a:1:{s:12:"created_time";i:1599269755;}i:237;a:1:{s:7:"caption";s:464:"TGIF

